import React, { Fragment } from "react";
import { useState, useEffect } from "react";
import axios from "axios";
//import home.css
import "./home.css";


export default function Home() {
  const [user_info, setUser_info] = useState([]);
  const [semesters, setSemesters] = useState([]);
  const [first_semester, setFirst_semester] = useState([]);
  const [remianing, setRemianing] = useState([]);
  const [fs_courses, setFs_courses] = useState([]);

  //handle submit for drop button
  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.delete("http://localhost:5000/home/drop", {
        course_id: event.target.value,
        year: first_semester.year,
        semester: first_semester.semester,

      }, { withCredentials: true });
      if (response.status === 200) {
        // refresh the page

        window.location.href = "/home";
      }
    } catch (e) {
      console.log("drop failed. Please try again.")
    }
  };





  useEffect(() => {
    axios.get("http://localhost:5000/home", { withCredentials: true })
      .then((res) => {
        setUser_info(res.data.user_info);
        setSemesters(res.data.semesters);
        setFirst_semester(res.data.semesters[0]);
        setFs_courses(res.data.semesters[0].courses);
        setRemianing(res.data.semesters.slice(1));
      });
  }
    , []);
  return (
    <div className="home">
      <h1 className="home__title">Home</h1>

      <div className="home__user-info">
        <h2 className="home__user-info-header">User Information:</h2>
        <p className="home__user-info-list">
          {user_info.map((info, index) => {
            return (
              <li key={index}><strong>ID:</strong> {info.id}</li>
            );
          })
          }
          {
            user_info.map((info, index) => {
              return (
                <li key={index}><strong>Name:</strong> {info.name}</li>
              );
            }
            )

          }
          {
            user_info.map((info, index) => {
              return (
                <li key={index}><strong>Department:</strong> {info.dept_name}</li>
              );
            }
            )
          }
          {
            user_info.map((info, index) => {
              return (
                <li key={index}><strong>Total Credits:</strong> {info.tot_cred}</li>
              );
            }
            )
          }


        </p>
      </div>

      <div className="home__current-semester">
        <h2 className="home__current-semester-header">Current Semester: {first_semester.year} {first_semester.semester}</h2>
        <table className="home__current-semester-table">
          <thead>
            <tr>
              <th>Course ID</th>
              <th>DROP</th>
            </tr>
          </thead>
          <tbody>
            {fs_courses.map((course, index) => {
              return (
                <tr key={index}>
                  <td>
                    <a href={`/course/${course.course_id}`}>
                      {course.course_id}
                    </a>
                  </td>
                  <td>
                    <button onClick={handleSubmit} value={course.course_id}>DROP</button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>

      {remianing.map((semester, index) => {
        return (
          <div key={index} className="home__previous-semester">
            <h2 className="home__previous-semester-header">{semester.year} {semester.semester}</h2>
            <table className="home__previous-semester-table">
              <thead>
                <tr>
                  <th>Course ID</th>
                  <th>Grade</th>
                </tr>
              </thead>
              <tbody>
                {semester.courses.map((course, index) => {
                  return (
                    <tr key={index}>
                      <td>
                        <a href={`/course/${course.course_id}`}>
                          {course.course_id}
                        </a>
                      </td>
                      <td>{course.grade}</td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        );
      })}
    </div>
  );

}
